{"Biografía":"MusicaPopular.cl

En 1999, la osornina ya aparecía como figura en extensas sesiones de música house con una residencia en el club Meridiano, y luego fue rostro y propuesta en continuas fiestas asociadas a Módulo Central, además de festivales realizados a lo largo de toda la década siguiente y espacios como La Feria, Tantra, Quinto Sol, La Batuta y La Salita. Se le ha asociado a esa misma armada chilena en Alemania (Dandy Jack, Ricardo Villalobos, Chica Paula, Dinky), y ha aparecido en sesiones de diverso formato con nombres que van desde Atom Heart y Jorge González hasta Mambotur, Marcelo Umaña, Zikuta, Kinaytra, DJ Larva y Latin Bitman. Junto al músico Rubén Roli Urzúa (Fiskales Ad-Hok), apareció en fiestas que introdujeron el pulso firme del electropunk. Luego de algunos años de trabajo en el sur del país, en la década de 2010, Burgos siguió activa en Santiago, asociada en colectivos de gestión y opinión, como Woman In Power (que codirigió junto a Adine Frost y Alisú).





